/** Get the task which is running.
 *
 * @retval Pointer to TCB of the running task.
 */
static inline osTCB_t* osSchedulerGetRunningT(void)
{
  for(int i=0; i<MAX_NUMBER_OF_TASKS; i++)
  {
    if(tasks[i].state == RUNNING)
      return &tasks[i];  
  }
  return NULL;
}

